import React, { useState } from 'react';
import { Search, Copy, CheckCircle, XCircle, AlertTriangle, Clock } from 'lucide-react';
import './App.css';

const App = () => {
  const [businessInput, setBusinessInput] = useState('');
  const [result, setResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [copied, setCopied] = useState(false);

  const responses = {
    notFound: {
      status: 'Business Not Found',
      icon: <XCircle className="w-6 h-6 text-red-500" />,
      color: 'border-red-200 bg-red-50',
      message: `Hello,\n\nI've searched our records and was unable to locate a business matching "${businessInput}". ...`
    },
    einMismatch: {
      status: 'EIN Mismatch',
      icon: <AlertTriangle className="w-6 h-6 text-yellow-500" />,
      color: 'border-yellow-200 bg-yellow-50',
      message: `Hello,\n\nI've located the business "${businessInput}" in our system, however there appears to be a mismatch with the EIN provided. ...`
    },
    watchlistHit: {
      status: 'Watchlist Hit',
      icon: <Clock className="w-6 h-6 text-orange-500" />,
      color: 'border-orange-200 bg-orange-50',
      message: `Hello,\n\nThank you for your submission. The business "${businessInput}" has been flagged in our system and requires additional review before verification can be completed.\n\n**Status:** Manual review required - compliance check in progress\n\n**What this means:**\n- Your business information is being reviewed by our compliance team\n- This is a standard procedure for certain business types or locations\n- No action is required from you at this time\n\n**Next Steps:**\n1. Our compliance team will review your business within 2–5 business days\n2. You will receive an email notification once the review is complete\n3. Additional documentation may be requested if needed\n\nWe appreciate your patience during this process. If you have urgent questions, please contact our compliance team directly.\n\nBest regards,\nSupport Team`
    },
    verified: {
      status: 'Verified',
      icon: <CheckCircle className="w-6 h-6 text-green-500" />,
      color: 'border-green-200 bg-green-50',
      message: `Hello,\n\nGreat news! The business "${businessInput}" has been successfully verified in our system. ...`
    }
  };

  const getRandomResult = () => {
    const outcomes = ['notFound', 'einMismatch', 'watchlistHit', 'verified'];
    return outcomes[Math.floor(Math.random() * outcomes.length)];
  };

  const handleCheckStatus = () => {
    if (!businessInput.trim()) return;
    setIsLoading(true);
    setTimeout(() => {
      setResult(responses[getRandomResult()]);
      setIsLoading(false);
    }, 1500);
  };

  const handleCopyResponse = async () => {
    if (!result) return;
    try {
      await navigator.clipboard.writeText(result.message);
      setCopied(true);
      setTimeout(() => setCopied(false), 2000);
    } catch (err) {
      console.error('Copy failed', err);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-purple-50 to-pink-50 py-10 px-4 font-sans">
      <div className="max-w-3xl mx-auto bg-white rounded-xl shadow-xl p-8">
        <div className="text-center mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-2">
            Business Identity Troubleshooting Companion
          </h1>
          <p className="text-gray-600 text-base">
            Enter a business name or EIN to check verification status and get support guidance
          </p>
        </div>

        <div className="flex gap-4 mb-6">
          <input
            type="text"
            value={businessInput}
            onChange={(e) => setBusinessInput(e.target.value)}
            placeholder="Enter business name or EIN..."
            className="flex-1 px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 outline-none text-lg"
          />
          <button
            onClick={handleCheckStatus}
            disabled={!businessInput.trim() || isLoading}
            className="px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 disabled:opacity-50 flex items-center gap-2 font-medium"
          >
            {isLoading ? (
              <>
                <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-white"></div>
                Checking...
              </>
            ) : (
              <>
                <Search className="w-5 h-5" />
                Check Status
              </>
            )}
          </button>
        </div>

        {result ? (
          <div className={`border-2 rounded-lg p-6 ${result.color}`}>
            <div className="flex items-center justify-between mb-4">
              <div className="flex items-center gap-3">
                {result.icon}
                <h2 className="text-xl font-semibold text-gray-800">{result.status}</h2>
              </div>
              <button
                onClick={handleCopyResponse}
                className="flex items-center gap-2 px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
              >
                <Copy className="w-4 h-4" />
                {copied ? 'Copied!' : 'Copy Response'}
              </button>
            </div>
            <div className="bg-white border border-gray-200 rounded-md p-4 overflow-auto max-h-[400px]">
              <pre className="whitespace-pre-wrap text-gray-700 text-sm leading-relaxed">
                {result.message}
              </pre>
            </div>
          </div>
        ) : (
          <div className="text-center py-12 text-gray-500">
            <Search className="w-12 h-12 mx-auto mb-4 opacity-30" />
            <p>Enter a business name or EIN above and click "Check Status" to get started</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
